import React from "react";
import projectphoto1 from "../../Images/25-11-21 Workshop/Picture 1.png";
import projectphoto2 from "../../Images/25-11-21 Workshop/Picture 2.png";
import projectphoto3 from "../../Images/25-11-21 Workshop/Picture 3.png";
import projectphoto4 from "../../Images/25-11-21 Workshop/Picture 4.png";

import "./CradUi.css";

const CardUi = () => {
  return (
    <div class="card">
        <div id="carouselExampleIndicators2" class="carousel slide" data-ride="carousel">
            <div class="carousel-inner">
                <div class="carousel-item active">
                    <img class="w-100" src="https://picsum.photos/1920/1080?random=4" alt="image"/>
                </div>
                <div class="carousel-item">
                    <img class="w-100" src="https://picsum.photos/1920/1080?random=5" alt="image"/>
                </div>
                <div class="carousel-item">
                    <img class="w-100" src="https://picsum.photos/1920/1080?random=6" alt="image"/>
                </div>
            </div>
            <a class="carousel-control-prev" href="#carouselExampleIndicators2" role="button" data-slide="prev">
                <span class="carousel-control-prev-icon" aria-hidden="true"></span>
                <span class="sr-only">Previous</span>
            </a>
            <a class="carousel-control-next" href="#carouselExampleIndicators2" role="button" data-slide="next">
                <span class="carousel-control-next-icon" aria-hidden="true"></span>
                <span class="sr-only">Next</span>
            </a>
        </div>
        </div>
  );
};

export default CardUi;
